function Greeting() {
    const user = {
      firstName: "Rodrigo",
      lastName: "Vásquez de Velasco",
    };
    return (
      <div>
        <h1>{user.firstName}</h1>
        <h3>{user.lastName}</h3>
      </div>
    );
  }

  export default Greeting;
